import React from "react";

const dummyEvents = [
  { id: "e1", title: "event1 ", date: "01/01/2024", image: null },
  { id: "e2", title: "event2 ", date: "01/03/2024", image: null },
  { id: "e3", title: "event3 ", date: "01/04/2024", image: null },
  { id: "e4", title: "event4 ", date: "01/05/2024", image: null },
];

const EventsPage = () => {
  return (
    <>
      <EventsList events={dummyEvents} />
    </>
  );
};

export default EventsPage;
